import React, { Fragment } from "react";

import Item from "./Item";

const ItemsList = (props) => {
  return (
    <Fragment>
      <div className={classes.container}></div>
      {props.items.map((item) => (
        <Item key={item.id} obj={item} />
      ))}
    </Fragment>
  );
};

export default ItemsList;
